import React, { Component, Fragment } from 'react';

class TimeSet extends Component {
  render() {
    return (
      <Fragment>
        {this.props.hour} {this.props.min} {this.props.sec} {this.props.miliSec}
        <div className="input-row">
          <input type="text" value={this.state.min} />
        </div>
      </Fragment>
    );
  }
}

TimeSet.defaultProps = {
  hour: 0,
  min: 0,
  sec: 0,
  miliSec:0
}

export default TimeSet;
